import React, { useState, useEffect } from 'react';
import axios from 'axios';

const titleStyle = {
    textAlign: 'left',
    marginLeft: '20px',
    color: '#4CAF50'
};

const inputStyle = {
    margin: '10px',
    padding: '10px',
    fontSize: '16px'
};

const buttonStyle = {
    margin: '10px',
    padding: '10px 20px',
    fontSize: '16px',
    backgroundColor: '#4CAF50',
    color: 'white',
    border: 'none',
    cursor: 'pointer'
};

const userListStyle = {
    marginTop: '40px',
    fontSize: '16px'
};

function Users() {
    const [users, setUsers] = useState([]);
    const [username, setUsername] = useState('');
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [premium, setPremium] = useState('No');  // New state for Premium
    const [geo, setGeo] = useState('Africa');  // Default to 'Africa', but you can set any default you want

    useEffect(() => {
        async function fetchUsers() {
            try {
                const response = await axios.get('http://localhost:3001/users');
                setUsers(response.data);
            } catch (error) {
                console.error("Error fetching users", error);
            }
        }

        fetchUsers();
    }, []);

    const addUserHandler = async () => {
        try {
            await axios.post('http://localhost:3001/users', { username, firstName, lastName, premium, geo });
            setUsername('');
            setFirstName('');
            setLastName('');
            setPremium('No');
            setGeo('Africa');
        } catch (error) {
            console.error("Error adding user", error);
        }
    };

    const deleteUserHandler = async (userId) => {
        try {
            await axios.delete(`http://localhost:3001/users/${userId}`);
            const updatedUsers = users.filter(user => user.userId !== userId);
            setUsers(updatedUsers);
        } catch (error) {
            console.error("Error deleting user", error);
        }
    };

    return (
        <div>
            <h3 style={titleStyle}>Add User</h3>
            <div>
                <input style={inputStyle} value={username} placeholder="Username" onChange={(e) => setUsername(e.target.value)} />
                <input style={inputStyle} value={firstName} placeholder="First Name" onChange={(e) => setFirstName(e.target.value)} />
                <input style={inputStyle} value={lastName} placeholder="Last Name" onChange={(e) => setLastName(e.target.value)} />
                <select style={inputStyle} value={premium} onChange={(e) => setPremium(e.target.value)}>
                    <option value="Yes">Yes</option>
                    <option value="No">No</option>
                </select>
                <select style={inputStyle} value={geo} onChange={(e) => setGeo(e.target.value)}>
                    <option value="Africa">Africa</option>
                    <option value="Asia">Asia</option>
                    <option value="Europe">Europe</option>
                    <option value="North America">North America</option>
                    <option value="South America">South America</option>
                    <option value="Australia">Australia</option>
                    <option value="Antarctica">Antarctica</option>
                </select>
                <button style={buttonStyle} onClick={addUserHandler}>Add User</button>
            </div>

            <div style={userListStyle}>
                <h3 style={titleStyle}>User List</h3>
                <ul>
                    {users.map(user => (
                        <li key={user.userId}>
                            {user.username} ({user.firstName} {user.lastName}) 
                            - Premium: {user.premium} 
                            - Geo: {user.geo}
                            <button style={{...buttonStyle, backgroundColor: '#f44336'}} onClick={() => deleteUserHandler(user.userId)}>Delete</button>
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default Users;
